import React, {Component} from 'react';
import {View, Button} from 'react-native';

class EventForm extends Component {
    render() {
        return (
            <View>
                <Button title='Add' onPress={this.props.navigation.goBack()}/>
            </View>
        );
    }
}
export default EventForm;
